description:
Chyna is She-Hulk!

She's hot, she's mean, and...she's green! Undisputed porn parody king Axel Braun and adult powerhouse Vivid Entertainment finally bring to life one of the most beloved comic book heroines, and who better than world-famous former WWF wrestling superstar Chyna to portray her? Sexy, funny, and outrageously entertaining, &quot;She-Hulk XXX: An Axel Braun Parody&quot; is a force to be reckoned with!

